import React, { useState } from 'react';

function Header() {
    const [fruits, setFruits] = useState(["Apple","Mango","Banana","Orange"
    ]);

    const handerColor = () => {
        setFruits(["Graps","Papaya","Carrot","Banana"])
    }
    return (
        <div>
            <ul>
            {fruits.map((item) => <li brand={item}>{item}</li>)}
            </ul>
            <button type="button" onClick={() => handerColor()}>click me!</button>
        </div>
    )
}

export default Header;
